import React from 'react'

function Dashpart() {
  return (
    <div>
        <div className='total-click'>TOtal Clicks  0</div>
        <div className='res-2'>
          <div className='date-wise'><span>Date-wise Clicks</span></div>
          <div className='click-devices'><span>Click Devices</span></div>
        </div>
    </div>
  )
}

export default Dashpart
